import React from 'react';
import styles from './StyleSelector.module.css';

const profileImages = [
  { id: 1, image: process.env.PUBLIC_URL + '/assets1/profile1.png' },
  { id: 2, image: process.env.PUBLIC_URL + '/assets1/profile2.png' },
  { id: 3, image: process.env.PUBLIC_URL + '/assets1/profile3.png' },
  { id: 4, image: process.env.PUBLIC_URL + '/assets1/profile4.png' },
  { id: 5, image: process.env.PUBLIC_URL + '/assets1/profile5.png' },
  { id: 6, image: process.env.PUBLIC_URL + '/assets1/profile6.png' },
  { id: 7, image: process.env.PUBLIC_URL + '/assets1/profile7.png' }
];

const styleOptions = [
  { id: 1, name: 'Basic jumpers' },
  { id: 2, name: 'Warm puffer' },
  { id: 3, name: 'Bomber' },
  { id: 4, name: 'Biker jacket' }
];

export default function StyleSelector() {
  return (
    <div className={styles.container}>
      {/* Top profile circles */}
      <div className={styles.profileCircles}>
        {profileImages.map((profile) => (
          <div key={profile.id} className={styles.profileCircle}>
            <img src={profile.image} alt={`Profile ${profile.id}`} />
          </div>
        ))}
      </div>

      {/* Main content */}
      <div className={styles.mainContent}>
        <div className={styles.imageWrapper}>
          <img 
            src={process.env.PUBLIC_URL + '/assets1/man.png'}
            alt="Style Preview"
            className={styles.mainImage}
          />
        </div>
      </div>

      {/* Bottom profile circles */}
      <div className={styles.profileCircles}>
        {profileImages.map((profile) => (
          <div key={profile.id} className={styles.profileCircle}>
            <img src={profile.image} alt={`Profile ${profile.id}`} />
          </div>
        ))}
      </div>

      {/* Style options */}
      <div className={styles.styleOptions}>
        {styleOptions.map((style) => (
          <button key={style.id} className={styles.styleButton}>
            {style.name}
          </button>
        ))}
      </div>

      {/* Bottom navigation */}
      <div className={styles.bottomNav}>
        <div className={styles.navItem}>
          <span className={styles.navIcon}>ðŸ‘”</span>
          <span>Collar</span>
        </div>
        <div className={`${styles.navItem} ${styles.active}`}>
          <span className={styles.navIcon}>ðŸ‘•</span>
          <span>Styles</span>
        </div>
        <div className={styles.navItem}>
          <span className={styles.navIcon}>ðŸ‘–</span>
          <span>Pant</span>
        </div>
        <div className={styles.navItem}>
          <span className={styles.navIcon}>ðŸ§¥</span>
          <span>Coat</span>
        </div>
        <div className={styles.navItem}>
          <span className={styles.navIcon}>ðŸ‘œ</span>
          <span>Accessories</span>
        </div>
        <div className={styles.navItem}>
          <span className={styles.navIcon}>ðŸ”§</span>
          <span>Tools</span>
        </div>
      </div>
    </div>
  );
}
